import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, useNavigate } from 'react-router-dom';
import axios from 'axios';
import logo from './Dineology_logo.jpeg';
import RestaurantDetails from './components/RestaurantDetails';

function App() {
  const [query, setQuery] = useState('');
  const [results, setResults] = useState([]);
  const [notFound, setNotFound] = useState(false);
  const navigate = useNavigate();

  const handleSearch = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:9200/restaurants/_search', {
        query: {
          multi_match: {
            query: query,
            fields: ['name', 'meal_type'],
          },
        },
      });
      const hits = response.data.hits.hits;
      setResults(hits);
      setNotFound(hits.length === 0);
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  const handleResultClick = (restaurant) => {
    navigate('/restaurant-details', { state: { restaurant: restaurant._source } });
  };

  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            <div className="App" style={styles.container}>
              <img src={logo} alt="Logo" style={styles.logo} />
              <form onSubmit={handleSearch} style={styles.form}>
                <input
                  type="text"
                  placeholder="Search for restaurants..."
                  value={query}
                  onChange={(e) => setQuery(e.target.value)}
                  style={styles.input}
                />
                <button type="submit" style={styles.button}>Search</button>
              </form>

              {notFound && (
                <p style={styles.notFoundMessage}>Not found</p>
              )}

              <div style={styles.resultsGrid}>
                {results.map((result) => (
                  <div key={result._id} style={styles.resultCard}>
                    <img
                      src={result._source.restaurant_photo_url}
                      alt={result._source.name}
                      style={styles.restaurantPhoto}
                    />
                    <div
                      style={styles.resultInfo}
                      onClick={() => handleResultClick(result)}
                    >
                      <h2 style={styles.resultName}>{result._source.name}</h2>
                      <p style={styles.resultLocation}>Madrid, España</p>
                      <p style={styles.resultPrice}>{result._source.price}</p>
                      <p style={styles.resultMealType}>{result._source.meal_type}</p>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          }
        />
        <Route path="/restaurant-details" element={<RestaurantDetails />} />
      </Routes>
    </Router>
  );
}

const styles = {
  container: {
    textAlign: 'center',
    padding: '50px',
    backgroundColor: '#f5f5f5',
  },
  logo: {
    width: '300px',
    marginBottom: '30px',
  },
  form: {
    display: 'flex',
    justifyContent: 'center',
    marginBottom: '20px',
  },
  input: {
    width: '400px',
    padding: '10px',
    fontSize: '16px',
    border: '1px solid #ccc',
    borderRadius: '5px',
  },
  button: {
    padding: '10px 20px',
    fontSize: '16px',
    marginLeft: '10px',
    border: 'none',
    borderRadius: '5px',
    backgroundColor: '#4285f4',
    color: '#fff',
    cursor: 'pointer',
  },
  notFoundMessage: {
    color: 'red',
    fontSize: '18px',
    margin: '20px 0',
  },
  resultsGrid: {
    display: 'flex',
    justifyContent: 'center',
    flexWrap: 'wrap',
    gap: '30px', // Aumentamos el espacio entre tarjetas
    maxWidth: '1400px', // Ancho máximo del grid para dar más espacio a las tarjetas
    margin: '0 auto',
  },
  resultCard: {
    flexBasis: '18%', // Permite mantener 5 tarjetas por fila
    maxWidth: '260px', // Ancho máximo para hacer que cada tarjeta sea más grande
    border: '1px solid #ccc',
    borderRadius: '15px', // Bordes más redondeados para una apariencia más moderna
    overflow: 'hidden',
    boxShadow: '0 6px 12px rgba(0,0,0,0.15)', // Sombra más marcada
    textAlign: 'center',
    transition: 'transform 0.2s', // Efecto hover suave
  },
  restaurantPhoto: {
    width: '100%',
    height: '250px', // Aumenta la altura de la imagen
    objectFit: 'cover',
  },
  resultInfo: {
    padding: '20px', // Más espacio interno para mayor separación del texto
    textAlign: 'left',
  },
  resultName: {
    fontSize: '20px', // Fuente más grande para el nombre del restaurante
    fontWeight: 'bold',
    margin: '5px 0',
  },
  resultLocation: {
    fontSize: '16px', // Fuente más grande para la ubicación
    color: '#777',
    margin: '5px 0',
  },
  resultPrice: {
    fontSize: '16px',
    fontWeight: 'bold',
    color: '#333',
    margin: '5px 0',
  },
  resultMealType: {
    fontSize: '16px',
    color: '#555',
    margin: '5px 0',
  },
};

export default App;
